import base64


class PicData(object):

    def __init__(self):
        super(PicData, self).__init__()

    @staticmethod
    def LogoPic():
        picData = ''
        return base64.b64decode(picData)

    @staticmethod
    def AppPic():
        picData = ''
        return base64.b64decode(picData)


